import React from 'react';
import '../App.css';

const initialState = {
    myOrder: []
}

class Order extends React.Component {

    constructor(props) {
        super(props);
        this.state = initialState;
    }

    componentDidMount() {
        const purl = "http://localhost:4000/myitem";
        fetch(purl).then(response => response.json())
        .then(json => {const cart = json.filter(cart => {
                return (cart.email===localStorage.getItem('userEmail') && cart.type==='order')
            })
            this.setState({ myOrder:cart })
        })
    }

    render (){
        const { myOrder } = this.state;
        if(localStorage.getItem('userEmail')){
            return (
                <div class="container">
                <br></br><br></br>
                    <div class="row justify-content-center">
                        <div class="col-md-10">
                            <div class="card">
                                <div class="card-header">My Order</div>
                                <div class="card-body">
                                    <tbody>
                                    {
                                        myOrder.map((my) =>

                                        <tr>
                                            <td class="tableTh" width="25%"><img width="200px" alt="" src={ "http://localhost:4000/"+my.proImage } class="img-thumbnail" /></td>
                                            <td class="tableTh" width="60%"><h3>{ myOrder.proName  }</h3><br/><h5>Price: Rs. { myOrder.proPrice } / Discount: Rs. { myOrder.proDiscount }</h5><br/><h5>Total: Rs. { myOrder.total } / Quantity: { myOrder.proQuantity }</h5></td>
                                            <td class="tableTh" width="25%"><img width="200px" alt="" src={ "http://localhost:4000/"+my.proImage } class="img-thumbnail" /></td>
                                            </tr>
                                    )}
                                    </tbody>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            );
        }
    }
}

export default Order;
